import React from 'react';
import Form from '../Form';
import Header from '../Header';
import './style.css';

const UserPage = ({ handleClick }) => {
  return (
    <>
      <Header handleClick={handleClick} />
      <div className="content container">
        <Form />
      </div>
    </>
  );
};

export default UserPage;
